import React, {useEffect, useState} from 'react';
import './App.css';
import Objective from "./components/Card/Objective.js";



function App() {
    const [state, setState] = useState({
        "objective": [
            {
                "title": "Objective 1",
                "id": "1",
                "task": [
                    {
                        "id": "3",
                        "title": "task1",
                        "specific": "sasdad",
                        "measurable": "ad",
                        "achievable": "ads",
                        "relevant": "asd",
                        "status": "asd"
                    },
                    {
                        "id": "4",
                        "title": "task2",
                        "specific": "sasdad",
                        "measurable": "ad",
                        "achievable": "ads",
                        "relevant": "asd",
                        "status": "asd"
                    }
                ]
            },
            {
                "title": "Objective 2",
                "id": "2",
                "task": [
                    {
                        "id": "5",
                        "title": "task12",
                        "specific": "sasdad",
                        "measurable": "ad",
                        "achievable": "ads",
                        "relevant": "asd",
                        "status": "asd"
                    },
                    {
                        "id": "6",
                        "title": "task22",
                        "specific": "sasdad",
                        "measurable": "ad",
                        "achievable": "ads",
                        "relevant": "asd",
                        "status": "asd"
                    }
                ]
            }
        ]
    })
    const handleClick = val =>
        setState({
            ...state,
            [val]: state[val] + 1
        })
    const {objective} = state

    return (
        <div>
            <p>Today I am {objective} Years of Age</p>

            <div>
                <button onClick={handleClick.bind(null, 'objective')}>Get older!</button>
            </div>
        </div>
    )
}
export default App;
